Wondering what “detangling Christian” means in my bio?

This video explains what it means to me today. But it will likely keep morphing.

I do NOT assert that my experience of Evangelical church applies to every church.  Or to your church. 

Your expression of your unique faith is not under attack!  I carry no judgement or authority on your faith walk. 

I am sharing MY experience from the four different evangelical churches I have been a member of over the last 22 years.

If knowing this about me makes you feel uncomfortable about me speaking into your parenting, I honor that. Be so careful of who you take advice from. Especially someone who would put your child in harms way with their toxic beliefs.

Feel free to Unfollow. 

I’m not at all interested in a back-and-forth biblical argument. I am very content with my private relationship with a radically inclusive God.  Learn more about me in stories.

What do you believe about a higher power? There is room for not knowing here.

Here are 20+ people I follow to help me sort through the rubble to save my tender faith. They can unpack progressive theology way better than I. Who should I add?

